import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'

function App() {
  return (
    <Router>
      <ul>
        <li>Home</li>
        <li>Contact</li>
      </ul>
      <Routes>
        <Route path=''/>
      </Routes>
    </Router>
  )
}

export default App;
